    data: |
      SELECT ALL * FROM tab1 (FORMAT parquet) WHERE + ( + 68 ) * + col2 * + col2 - + - col0 * ( + + col1 ) + + 53 IS NOT NULL;
  - name: tab1

outputs:
  - name: q11068.out
    data: |
      51	14	96
      85	5	59
      91	47	68
